import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCheckSquare, appointment, faCoffee,fasitting } from '@fortawesome/fontawesome-free-solid'
import "./sidebar.css"
const Sidebar = () => {
    return (
        <div>
           
        <FontAwesomeIcon icon={fadashboard} /> <button >Coffee</button> <br/> <br/>
        <FontAwesomeIcon icon={faappointment} /> <button>Coffee</button> <br/> <br/>
        <FontAwesomeIcon icon={fasitting} /> <button>Coffee</button> <br/> <br/>
        </div>
    );
};

export default Sidebar;
